import React from 'react';
import { useParams } from 'react-router-dom';

const ProductPage = () => {
  const { brand, productDetails } = useParams();

  // Используйте brand и productDetails для загрузки и отображения информации о товаре

  return (
    <div>
      <h2>{brand} Product Details</h2>
      <p>Product ID: {productDetails}</p>
      {/* Другие детали о товаре */}
    </div>
  );
};

export default ProductPage;
